★コロンビアのヒップバッグ！<br>
<br>
●複数のポケット付きで小物を整理して収納できる、便利なヒップバッグです。<br>
●フロントには小物やスマートフォンを収納できるポケット付で、ポータブルプレーヤーのイヤホンコードを通すホールも装備！<br>
●内部には小分けに便利なジッパー式メッシュポケット付き。<br>
●カジュアルなアウトドアファッションとしてもおしゃれなバッグです。<br>
<br>
■素材<br>
表地：ポリエステル100％<br>
メッシュ部分：ポリエステル100％<br>
裏地：ポリエステル100％<br>
<br>
(013カラー)別布部分：合成皮革<br>
(014カラー)別布部分：コットン60％、ポリエステル40％<br>
(326カラー)別布部分：ポリエステル50％、レーヨン50％<br>
(448、824カラー)別布部分：ポリエステル60％、コットン40％<br>
(465カラー)別布部分：ウール50％、ポリエステル50％<br>
